import React from "react";
import "./MainPage.css";
import NavBar from "../NavBar/NavBar";
import Weather from "../Weather/Weather";
const MainPage = () => {
  return (
    <div className="main-container">
      <NavBar />
      <Weather />
    </div>
  );
};
export default MainPage;
